value.transcript:
={{ 
  !$json.body.call?.transcript || 
  $json.body.call.transcript.trim() === "" || 
  !/user|cliente|nombre del usuario/i.test($json.body.call.transcript) || 
  /buzón de voz|mensaje automático|la persona no está disponible|seu recado|deje su mensaje|número no disponible/i.test($json.body.call.transcript) 
    ? (/buzón de voz|mensaje automático|seu recado|deje su mensaje/i.test($json.body.call.transcript) 
        ? "voicemail_reached" 
        : $json.body.call.disconnection_reason) 
    : $json.body.call.transcript 
}}
